class DataModel {
  DataModel({
      num? page, 
      num? perPage, 
      List<Photos>? photos, 
      num? totalResults, 
      String? nextPage,}){
    _page = page;
    _perPage = perPage;
    _photos = photos;
    _totalResults = totalResults;
    _nextPage = nextPage;
}

  DataModel.fromJson(dynamic json) {
    _page = json['page'];
    _perPage = json['per_page'];
    if (json['photos'] != null) {
      _photos = [];
      json['photos'].forEach((v) {
        _photos?.add(Photos.fromJson(v));
      });
    }
    _totalResults = json['total_results'];
    _nextPage = json['next_page'];
  }
  num? _page;
  num? _perPage;
  List<Photos>? _photos;
  num? _totalResults;
  String? _nextPage;
DataModel copyWith({  num? page,
  num? perPage,
  List<Photos>? photos,
  num? totalResults,
  String? nextPage,
}) => DataModel(  page: page ?? _page,
  perPage: perPage ?? _perPage,
  photos: photos ?? _photos,
  totalResults: totalResults ?? _totalResults,
  nextPage: nextPage ?? _nextPage,
);
  num? get page => _page;
  num? get perPage => _perPage;
  List<Photos>? get photos => _photos;
  num? get totalResults => _totalResults;
  String? get nextPage => _nextPage;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['page'] = _page;
    map['per_page'] = _perPage;
    if (_photos != null) {
      map['photos'] = _photos?.map((v) => v.toJson()).toList();
    }
    map['total_results'] = _totalResults;
    map['next_page'] = _nextPage;
    return map;
  }

}

